# Example with jsonnet code in archive (suitable if you have complicated file structure)
#
# In order to correctly run this exmple you have to install following jsonnet depedencsies
# with help of --libsonnet keyword argument of program (see helpers/README.md how to set folder
# for dependencies if you run translator outside container):
# --libsonnet https://github.com/grafana/grafonnet-lib/grafonnet@ff69572caf78c3163980d0d723c85a722eab73d9 \
#             https://github.com/bitnami-labs/kube-libsonnet@2c48e8e3fb40e38461ba27b05a290877c1e39cec \
#             https://github.com/thelastpickle/grafonnet-polystat-panel@275a48de57afdac0d72219d82863d8ab8bd0e682

apiVersion: v1
binaryData:
  jsonnet.tar.gz: 
kind: ConfigMap
metadata:
  name: tar-jsonnet-cm
  namespace: default
  labels:
    grafana_dashboard_jsonnet: "1"
  annotations:
    # config map with archive data, has to have annotation `jsonnet_filename: path/to/file` which defines
    # which file after archive extraction should be build
    jsonnet_filename: "jsonnet_orig/dashboard.jsonnet"
    grafana_label: "grafana_dashboard=1"
